import React from "react";
import J_logo from '../Assets/J.png'
import { Link, NavLink } from "react-router-dom";

const NavigationBar = () => {
    
    return (

        <div>
            <img src={J_logo} alt="None" style={{width:"100px"}}></img>

            <ul>
                <li>
                    <Link to="/" >Home</Link>
                </li>
                <li>
                    <Link to="/about">About</Link>
                </li>
                <li>
                    <Link to="/creatorhub">Creator Hub</Link>
                </li>
                <li>
                    <NavLink style={()=>{
                        return {backgroundColor:"pink"}
                    }} to="/author/2">Article author</NavLink>
                </li>
            </ul>
        </div>

    );

}

export default NavigationBar;
